import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {apiResponse: ''}
    }

    callAPI() {
        fetch("http://localhost:9000/kings")
            .then(res => res.text())
            .then(res => this.setState({apiResponse: JSON.parse(res)}))
    }

    componentDidMount() {
        this.callAPI()
    }

    render() {
        let m = this.state.apiResponse;
        let x = [];
        for(let i = 0; i < m.length; i++) {
            x.concat(<li> {m[i]} </li>);
        }
        // let items = x;
        return (
            <div className="App">
                <ul>{x}</ul>
            </div>
        );
    }
}

export default App;
